import styled from "styled-components";

export const Title = styled.p`
    font-size: 2rem;
    text-align: center;
    margin-top: 10%;
    color: black;
    font-weight: bold;
`

export const Content = styled.div`
    background-color: aliceblue;
    min-height: 100vh;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
`
